q.de(1638,"London Baptists organize first Particular Baptist Church",o,"The first Particular Baptist Church, founded in 1638, began as a separation from the General Baptist Church on the doctrine of atonement. The General Baptists affirmed general atonement, the idea that \u201cChrist died for all people generally, and that whoever would believe in Christ could be saved\u201d \u2013 whereas the Particular Baptists affirmed particular atonement, the idea that \u201cChrist died only for a particular group, the elect\u201d. General Baptists believed that salvation could be lost, Particular Baptists believed that once saved one is always saved. Particular Baptists later regularly practiced baptism by immersion, as shown in the confessions of faith drafted by several churches in 1644.3 Later in America, these churches provided \u201cleadership for the growth that characterized American Baptist life during the decades immediately preceding the American Revolution\u201d.")
