q.de(1830,"Baptists Disfellowship Cambellites",o,"Alexander Campbell, the founder of the \u201cCampbellites\u201d, was born 1788 in Ireland and later immigrated to the Unites States as a young adult. Campbell preached amongst Presbyterians and then later amongst Baptists \u2013 he was distinguished by a growing frustration with denominational rivalry and sought to reclaim the \u201cancient church\u201d. He became well acclaimed for his support of baptism and debates with Presbyterians regarding the mode of baptism. This later became an issue for Baptists when Campbellite churches began to claim to be true Baptists, despite differing greatly on the substance and meaning of what Baptism is (such as the Campbellite belief of baptismal regeneration \u2013 the idea that baptism granted the remission of sins). In 1830 Baptists disfellowshipped with Campbellites over these issues, and the result is that Baptists had to define themselves denominationally in terms of not only the means and purpose of baptism, but it\u2019s effects and other doctrinal distinctives outside of baptism.")
r.push(q)
q=new F.aI()
q.de(1845,"Southern Baptist Convention (including Foreign and Home Mission Boards)",o,"In 1845, the Southern Baptist Convention was organized as a collection of Baptist churches that \u201cdisagreed with the antislavery attitudes and activities of Northern Baptists\u201d. At this first meeting, the Board of Domestic Missions (or Home Mission Board) was founded with the intention of taking \u201cthe gospel of Christ across the home fronts of North America\u201d and is now known as The North American Mission Board (NAMB). Additionally, the Foreign Mission Board, now known as The International Mission Board (IMB) was created with the mission of \u201ctaking the gospel to the ends of the earth\u201d. Southern Baptists have since repudiated their controversial beginnings and taken a firm stance against any form of racism.")
