q.de(1925,"Baptists adopt Cooperative Program and Baptist Faith and Message",o,"As early as 1919, the Southern Baptists issued a \u201cFraternal Address\u201d to Baptists worldwide in order that there might be \u201ca means by which to identify their oneness with Southern Baptists\u201d. Ironically, this was taken offensively and caused further division as the Northern Baptists perceived this to be a \u201cwedge to divide\u201d. To smooth over the misunderstanding, leaders from both the Northern and Southern conventions met to discuss and later release jointly a confession meant to unite Baptists \u2013 which eventually came to be the Baptist Faith and Message in 1925. In addition, the Cooperative Program was founded in 1925 as the result of a desire to fund missions and ministries of the SBC and of individual state conventions. This program facilitates the SBC\u2019s desire to allow for authority to reside in localized churches and yet also allows for local churches to contribute to a broader global mission by cooperating in giving for the explicit purpose of ministry and missions.")
