q.de(1961,"Ralph Elliot\u2019s Message of Genesis",o,"Ralph Elliott was the chair of the Old Testament department at Midwestern Baptist Theological Seminary and authored a book entitled The Message of Genesis. Elliott employed a historical-critical method of interpretation to the book of Genesis and argued \u201cit was not literal history, but that it could be religious truth nonetheless\u201d. This preceded the 1962 SBC annual meeting and led to great controversy \u2013 prompting the writing of the Baptist Faith and Message of 1963 (which affirmed the inerrancy of Scripture at seminaries and SBC institutions).")
