s.de(1629,"William Screven",n,"William Screven was the first Baptist minister in the South, \u201cwho with a group of Baptists from Kittery, Maine formed the earliest Baptist church in the South in the late 1600\u2019s\u201d. William was a born in England where he was a Baptist, moved to Maine, and established a Baptist church in Kittery, Maine. 16 years after planting the church in Kittery, William \u201cled his church to Charleston, S.C.\u201d until later moving to Georgetown \u2013 where he ministered until 1713, when he passed away.")
p.push(s)
s=new F.aI()
s.de(1706,"Shubal Stearns",n,"Shubal Stearns entered the world at the onset of the eighteenth century, born 1706 in Boston, Massachusetts.5 At some point he heard George Whitefield preach (likely somewhere between 1740-1750), and was ordained a minister of the Separate Congregational Church in Tolland, where he and his family experienced a \u201cNew Birth\u201d. Due to this, his congregation placed a heavy emphasis on the work of the Holy Spirit and various giftings and came to be known for Stearn\u2019s \u201choly whine\u201d. By 1765 the congregation grew greatly and later split under poor administration.")
p.push(s)
s=new F.aI()
s.de(1723,"Oliver Hart",n,"Oliver Hart was a Pennsylvania man, born in 1723.6 Hart answered the call to ministry from Charleston Baptist Church in 1749, and pastored there for 30 years. Hart advocated for organization within the larger Southern Baptist denomination, and pushed for a single denominational structure to \u201csupport missions and ministry in a geographical area\u201d. Later this idea propagated down to the Southern Baptist Convention itself.")
p.push(s)
s=new F.aI()
s.de(1753,"David Barrow",n,"Reverend David Barrow was a writer and preacher of the mid-eighteenth, early nineteenth century. He was born in Brunswick Co., VA, in 1753 and began to preach by the time he was 18 years old. He was later ordained and preached throughout Virginia and North Carolina. Barrow divided his own church when he advocated for the abolition of slavery in the South and later published a book against it.")
p.push(s)
s=new F.aI()
s.de(1794,"John Dagg",n,"John Leadley Dagg was born shortly before the nineteenth century (1794) and lived for the vast majority of it until he passed away at 90 years old. Dagg was an educator and theologian in the American Baptist community, and profoundly impacted Baptist thought despite struggling against \u201ca limited education, near-blindness, and being crippled\u201d. He pastored in Philadelphia, educated in Alabama, and served as president at Mercer University \u2013 although he is best known for his contributions in retirement as the first American Baptist to compose a systematic theology.")
p.push(s)
s=new F.aI()
s.de(1811,"James M. Pendleton",n,"James M. Pendleton was a preacher and author born in Spottsylvania County, Virginia, on November 20, 1811. His father moved the family to Christian County, Kentucky, where Pendleton grew up and learned to work the farm most of the year and was taught by his father in the winter \u2013 he later was ordained to be a pastor in 1830 (although was met with several discouraging complaints of his preaching). He preached at a variety of churches but is known for his 18-year pastorate in Baptist church at Upland, Pennsylvania, where there were several revivals (one of which 200 converts were baptized at once). He contributed much as an author and served as an editor for the Southern Baptist Review. Although Pendleton did not refer to himself as an abolitionist and rather preferred the term \u201cemancipationist\u201d, and desired for slavery to be dealt with in a gradual and just manner according to State Constitution and law.")
p.push(s)
s=new F.aI()
s.de(1848,"James M. Frost",n,"James M. Frost was born February 10, 1848, in Georgetown, KY, and died in Nashville, TN, on October 30, 1916. He served as the pastor of several churches throughout his life, however while pastoring in Richmond James Frost hung up and framed resolutions that later \u201cled to the establishment of the Sunday School Board\u201d of the Southern Baptist Convention. He led the Sunday School Board as the first secretary to be a publishing house, and created a curriculum that adhered to Scripture and to denomination tradition.")
p.push(s)
s=new F.aI()
s.de(1908,"Bill Wallace",n,"Bill Wallace was a Southern Baptist missionary and surgeon, who was regarded highly for his devotion to his patients in the midst of war. He was born in 1908 and died in 1951 after having been imprisoned by the Chinese Communist regime on the charge of being a spy and after having been interrogated and tortured. He changed the negative thoughts of many Chinese who had heard many missionary sermons, but \u201cin Bill Wallace they began to see one\u201d \u2013 and because of this thousands of Chinese mourned his death and marked his grave: \u201cFor me to live is Christ, Phil. 1:21\u201d.")
p.push(s)
s=new F.aI()
s.de(1914,"Duke McCall",n,"Duke K. McCall served as The Southern Baptist Theological Seminary\u2019s seventh president and he was born in Meridian, Mississippi in 1914. Following college Duke sought out ministerial training and earned the Th.M. degree in 1938 and later his Doctor of Theology degree in 1942. He became the president of the New Orleans Baptist Theological Seminary and later the president of Southern after Fuller\u2019s death in 1950. Under McCall, Southern grew larger and sturdier through decades of difficult challenges \u2013 eventually naming a pavilion after him on Southern\u2019s 150th anniversary.")
